import React from 'react';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import './App.css';
import Login from "./Pages/Login";
import Dashboard from "./Pages/Main/Dashboard";
import Deposit from './Pages/Main/Deposit';
import Transfer from "./Pages/Main/Transfer";
import useToken from './useToken';
import AccountInfo from './Pages/Main/AccountInfo';
import PIN from './Pages/PIN';
import Registration from './Pages/Registration';

function App() {
  const { token, setToken } = useToken();

  if (!token) {
    return (
      <Router>
        <Login setToken={setToken} />
      </Router>
    );
  }

  return (
    <Router>
      <div className="App">
        <ToastContainer position="top-center" />
        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route exact path="/deposit" element={<Deposit />} />
          <Route exact path="/transfer" element={<Transfer />} />
          <Route exact path="/accountinfo" element={<AccountInfo />} />
          <Route exact path="/PIN" element={<PIN />} />
          <Route path="/register" element={<Registration />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
